final class HighchartsYAxisTest extends PHPUnit_Framework_TestCase {

	/**
	 * Test the clear() method.
	 *
	 * @return void
	 */
	public function testClear() {

		$obj = new \WBW\HighchartsBundle\API\Chart\HighchartsYAxis(false);

		$obj->clear();
		$this->assertEquals([], $obj->toArray(), "The method toArray() does not return the expected array");
	}

	/**
	 * Tests the newCrosshair() method.
	 *
	 * @return void.
	 */
	public function testNewCrosshair() {

		$obj = new \WBW\HighchartsBundle\API\Chart\HighchartsYAxis(false);

		$res = $obj->newCrosshair();
		$this->assertInstanceOf(\WBW\HighchartsBundle\API\Chart\YAxis\HighchartsCrosshair::class, $res, "The method newCrosshair() does not return the expected class");
	}

